import React from 'react';

type TechStackProps = {
  t: {
    title: string;
  };
};

const logos = [
  {
    name: 'OpenAI',
    svg: (
      <svg height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
        <g>
          <path d="M20 3.5c4.5 0 8.5 2.2 10.9 5.7l-4.7 2.7c-1.5-2.1-4-3.4-6.7-3.4-2.7 0-5.2 1.3-6.7 3.4l-4.7-2.7C11.5 5.7 15.5 3.5 20 3.5zm13.5 7.2l-2.7 4.7c2.1 1.5 3.4 4 3.4 6.7 0 2.7-1.3 5.2-3.4 6.7l2.7 4.7c3.5-2.4 5.7-6.4 5.7-10.9 0-4.5-2.2-8.5-5.7-10.9zM20 36.5c-4.5 0-8.5-2.2-10.9-5.7l4.7-2.7c1.5 2.1 4 3.4 6.7 3.4 2.7 0 5.2-1.3 6.7-3.4l4.7 2.7c-2.4 3.5-6.4 5.7-10.9 5.7zm-13.5-7.2l2.7-4.7c-2.1-1.5-3.4-4-3.4-6.7 0-2.7 1.3-5.2 3.4-6.7l-2.7-4.7C3.5 15.5 1.3 19.5 1.3 24c0 4.5 2.2 8.5 5.7 10.9z" fill="#10A37F"/>
        </g>
      </svg>
    ),
  },
  {
    name: 'Tailwind CSS',
    svg: (
      <svg height="40" viewBox="0 0 48 28" fill="none" xmlns="http://www.w3.org/2000/svg">
        <g>
          <path d="M13.5 0C7.5 0 4.5 3.5 4.5 10.5C4.5 17.5 7.5 21 13.5 21C16.5 21 18.5 19.5 19.5 16.5C20.5 19.5 22.5 21 25.5 21C31.5 21 34.5 17.5 34.5 10.5C34.5 3.5 31.5 0 25.5 0C22.5 0 20.5 1.5 19.5 4.5C18.5 1.5 16.5 0 13.5 0Z" fill="#38BDF8" />
          <path d="M34.5 7C40.5 7 43.5 10.5 43.5 17.5C43.5 24.5 40.5 28 34.5 28C31.5 28 29.5 26.5 28.5 23.5C27.5 26.5 25.5 28 22.5 28C16.5 28 13.5 24.5 13.5 17.5C13.5 10.5 16.5 7 22.5 7C25.5 7 27.5 8.5 28.5 11.5C29.5 8.5 31.5 7 34.5 7Z" fill="#38BDF8" />
        </g>
      </svg>
    ),
  },
  {
    name: 'React',
    svg: (
      <svg height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
        <circle cx="20" cy="20" r="2.5" fill="#61DAFB" />
        <g stroke="#61DAFB" strokeWidth="2">
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" />
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" transform="rotate(60 20 20)" />
          <ellipse rx="17" ry="7" cx="20" cy="20" fill="none" transform="rotate(120 20 20)" />
        </g>
      </svg>
    ),
  },
];

const TechStack: React.FC<TechStackProps> = ({ t }) => (
  <section className="w-full py-10 bg-white dark:bg-[#23272f] flex flex-col items-center transition-colors">
    <h2 className="text-xl font-semibold text-gray-700 dark:text-gray-200 mb-6">{t.title}</h2>
    <div className="flex flex-row gap-10 items-center justify-center">
      {logos.map((logo) => (
        <span
          key={logo.name}
          className="flex items-center justify-center transition-transform hover:scale-110"
          title={logo.name}
        >
          {logo.svg}
        </span>
      ))}
    </div>
  </section>
);

export default TechStack;
